import React, { useState, useEffect } from 'react';
import Avatar from '@mui/material/Avatar';
import Button from '@mui/material/Button';
import CssBaseline from '@mui/material/CssBaseline';
import TextField from '@mui/material/TextField';
import FormControlLabel from '@mui/material/FormControlLabel';
import Checkbox from '@mui/material/Checkbox';
import Link from '@mui/material/Link';
import Grid from '@mui/material/Grid';
import Box from '@mui/material/Box';
import LockOutlinedIcon from '@mui/icons-material/LockOutlined';
import Typography from '@mui/material/Typography';
import Container from '@mui/material/Container';
import { createTheme, ThemeProvider } from '@mui/material/styles';
import InputLabel from '@mui/material/InputLabel';
import Select from '@mui/material/Select';
import MenuItem from '@mui/material/MenuItem';
import FormControl from '@mui/material/FormControl';
function Copyright(props) {
  return (
    <Typography variant="body2" color="text.secondary" align="center" {...props}>
      {'Copyright © '}
      <Link color="inherit" href="https://mui.com/">
        Your Website
      </Link>{' '}
      {new Date().getFullYear()}
      {'.'}
    </Typography>
  );
}

// TODO remove, this demo shouldn't need to reset the theme.

const defaultTheme = createTheme();

export default function SignUp() {
  const [age, setAge] = React.useState('');
  const [provice, setData] = useState([]);
  const [amphur, setData1] = useState([]);
  useEffect(() => {

      async function getJSON() {

            const response = await fetch("http://localhost:3333/getprovice", {
              method: "GET", // or 'PUT'


            });



            const data = await response.json();




          setData(data);

        }
        getJSON();
        async function getJSON1() {

          const response = await fetch("http://localhost:3333/getamphures", {
            method: "GET", // or 'PUT'


          });



          const data = await response.json();




        setData1(data);

      }
      getJSON1();
      }, [])
      console.log(provice,amphur);
  const handleSubmit = (event) => {
    event.preventDefault();
    const data = new FormData(event.currentTarget);

  const  jsonData = {
        email: data.get('email'),
        password: data.get('password'),
        fname : data.get('firstName'),
        lname : data.get('lastName'),
    }
    async function postJSON(jsonData) {
        try {
          const response = await fetch("http://localhost:3333/register", {
            method: "POST", // or 'PUT'
            headers: {
              "Content-Type": "application/json",
            },
            body: JSON.stringify(jsonData),
          });

          const result = await response.json();
          console.log("Success:", result);
          if(result.status==='ok'){
            localStorage.setItem('token',result.token)
            window.location='/login'
            alert('regsiter ok')
          }else {
            window.location='/register'
            alert('lregsiter fail')
          }

        } catch (error) {
          console.error("Error:", error);
        }
      }


      postJSON(jsonData);
  };



  const handleChange = (event) => {
    setAge(event.target.value);
  };
  return (
    <ThemeProvider theme={defaultTheme}>
      <Container component="main" maxWidth="xs">
        <CssBaseline />
        <Box
          sx={{
            marginTop: 8,
            display: 'flex',
            flexDirection: 'column',
            alignItems: 'center',
          }}
        >
          <Avatar sx={{ m: 1, bgcolor: 'secondary.main' }}>
            <LockOutlinedIcon />
          </Avatar>
          <Typography component="h1" variant="h5">
            Sign up
          </Typography>
          <Box component="form" noValidate onSubmit={handleSubmit} sx={{ mt: 3 }}>
            <Grid container spacing={2}>
            <Grid item xs={12}>
                <TextField
                  required
                  fullWidth
                  id="IDnumber"
                  label="เลขบัตรประชาชน"
                  name="email"
                  autoComplete=""
                />
              </Grid>
              <Grid item xs={12} sm={6}>
                <TextField
                  autoComplete="given-name"
                  name="firstName"
                  required
                  fullWidth
                  id="firstName"
                  label="ชื่อ"

                />
              </Grid>
              <Grid item xs={12} sm={6}>
                <TextField
                  required
                  fullWidth
                  id="lastName"
                  label="สกุล"
                  name="lastName"

                />
              </Grid>
              <Grid item xs={12}>
                <TextField
                  required
                  fullWidth
                  id="nation"
                  label="สัญชาติ"
                  name="natoin"

                />
              </Grid>
              <Grid item xs={12}>
                <TextField
                  required
                  fullWidth
                  id="status"
                  label="สถานะ"
                  name="natoin"

                />
              </Grid>
              <Grid item xs={12}>
                <TextField
                  required
                  fullWidth
                  id="tel"
                  label="เบอร์โทร"
                  name="tel"

                />
              </Grid>
            <Grid item xs={12}>
            <FormControl fullWidth>
        <InputLabel >จังหวัด</InputLabel>
        <Select label="Age" id="countrySelect" value={age}    onChange={handleChange} >
          {provice.map((row) => (
            <MenuItem key={row.id} value={row.code}>
              {row.name_th}
            </MenuItem>
          ))}
        </Select>
        </FormControl>
            </Grid>

            </Grid>
            <Button
              type="submit"
              fullWidth
              variant="contained"
              sx={{ mt: 3, mb: 2 }}
            >
              เปิดเคส
            </Button>
            <Grid container justifyContent="flex-end">
              <Grid item>
                <Link href="#" variant="body2">
                  Already have an account? Sign in
                </Link>
              </Grid>
            </Grid>
          </Box>
        </Box>
        <Copyright sx={{ mt: 5 }} />
      </Container>
    </ThemeProvider>
  );
}
